text:
@70sul خالد مشعل ؛؛ نشكر السيد أردوغان علي التطبيع المثمر مع العدو الصهيوني
لما سيسفر ذلك عن فتح قناة اتصال قوية للحركة مع العدو و فك جزئي للحصار عليها
أما اقامة علاقات بين الامارات واسرائيل مكافئة محانية للاحتلال الاسرائيلي ،، حماس منظمة ارهابية فارسية لايعنيها عدوة القضية الفلسطينية،،

#حمد_بن_جاسم غرّد و حُذفت التغريدة.

( و الحكم يبقى في يد الأجدر به )

@hamadjjalthani

@aa_arabic 2.4 مليار جرعة  شاورمه 
اصلا تركيا لم تتوصل الى لقاح و لم تمنح ترخيص اى شركه لانتاح اللقاح،،،،، و اللقاح المستورد تم استخدامه لتلقيح حاشيه اردوغان و بعض اعضاء حزب العداله و التنميه الحاكم
 اوغور هذا  لا يعلم ان تركيا  امس سجلت 22216 حالة إصابة جديدة بفيروس كورونا
